// Import the functions you need from the SDKs you need
import { initializeApp } from "firebase/app";
import { getAnalytics } from "firebase/analytics";

const firebaseConfig = {
    apiKey: "AIzaSyCoS5cO2qelwGQgnheGsbmeT6pSG2CIZj8",
    authDomain: "fypcloud-1dee1.firebaseapp.com",
    projectId: "fypcloud-1dee1",
    storageBucket: "fypcloud-1dee1.appspot.com",
    messagingSenderId: "811878063918",
    appId: "1:811878063918:web:e86c96ad6225fa3401a4bf",
    measurementId: "G-B2B9EEJ094"
};

const app = initializeApp(firebaseConfig);
const analytics = getAnalytics(app);

export { app, analytics };
